class Solution {
  static const int mod = 1000000007;

  int countSubMultisets(List<int> nums, int l, int r) {
    int maxSum = nums.reduce((a, b) => a + b);
    List<int> prefixSum = List.filled(maxSum + 1, 0);

    // Calculate prefix sums for the count of subsets with each sum
    for (int num in nums) {
      for (int i = maxSum; i >= num; i--) {
        prefixSum[i] = (prefixSum[i] + prefixSum[i - num]) % mod;
      }
      prefixSum[num] = (prefixSum[num] + 1) % mod; // Include the single element subset
    }

    // Convert prefix sums to actual counts of subsets within range [l, r]
    for (int i = 1; i <= maxSum; i++) {
      prefixSum[i] = (prefixSum[i] + prefixSum[i - 1]) % mod;
    }

    int countL = l > 0 ? prefixSum[l - 1] : 0;
    int countR = prefixSum[r];

    return (countR - countL + mod) % mod;
  }
}
